import React, { useState } from "react";
import MobileMenu from "./MobileMenu";
import { logo, menu, cart, user, wishlist, searchIcon } from "./Index";

const Header = () => {


  return (
    <nav className="bg-whit p-4 relative flex flex-col md:flex-row md:items-center md:justify-start">
      {/* Logo */}
      <div className="w-32 h-14 mb-2 md:mb-0 md:left-0 md:top-0 relative">
        <img
          className="w-32 h-7 justify-center items-center"
          src={logo}
          alt="Logo"
        />
      </div>
      {/* Search Bar */}
      <div className="h-screen w-screen flex justify-center items-center">

        <form  action="/search" class="max-w-[480px] w-full px-4"
        >
          <div className="relative">
            <input
              type="text" class="w-full border h-12 shadow p-4 rounded-full"
              name="query"
              placeholder="Search..."
            />
            <button type="submit">
              <img

                src={searchIcon}
                alt="searchIcon"
                type="search"
                className="h-5 w-5 absolute top-3.5 right-3 fill-current bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-green-700 focus:border-green-700"
              />
            </button>
          </div>
        </form>


      </div>



    </nav>
  );
};

export default Header;
